INSERT INTO `v1_60e16fa3edc5d9f0eca1c7402097ef140dc5f7b6ced936531fa089742840dbf7` VALUES (11, 6, 0, 117531, 0, "あら。\nこないだぷりぷりして帰った件は\n綺麗さっぱりなかったことにするのね。\nオーケイ、了解よ。", 1, 1007405, 1007405034, 0.5, 0);
