INSERT INTO `v1_60e16fa3edc5d9f0eca1c7402097ef140dc5f7b6ced936531fa089742840dbf7` VALUES (11, 7, 0, 117531, 0, "それで？\nユニちゃんは今日も\n私と雑談をしに来てくれたのかしら？", 1, 1007405, 1007405038, 0.5, 0);
