INSERT INTO `v1_60e16fa3edc5d9f0eca1c7402097ef140dc5f7b6ced936531fa089742840dbf7` VALUES (11, 5, 0, 111011, 0, "否。\n今日は患者として参ったのだ。\n医薬の道に長じた御身の助けを得たい。", 1, 1007405, 1007405043, 0.5, 0);
