INSERT INTO `v1_60e16fa3edc5d9f0eca1c7402097ef140dc5f7b6ced936531fa089742840dbf7` VALUES (11, 6, 0, 111011, 0, "いや、結構。\n学院の都合で押しつけられた\n名誉学位などニックネームにも同義だ。", 1, 1007406, 1007406042, 0.5, 0);
