INSERT INTO `v1_60e16fa3edc5d9f0eca1c7402097ef140dc5f7b6ced936531fa089742840dbf7` VALUES (103, 0, "", "私の血を吸ってみる？", "", 1007410066, "", 1007410, 1007410053, "", "");
INSERT INTO `v1_60e16fa3edc5d9f0eca1c7402097ef140dc5f7b6ced936531fa089742840dbf7` VALUES (103, 0, "", "私の目、使っちゃおうかしら？", "", 1007410072, "", 1007410, 1007410054, "", "");
